def agent_action(execution_engine, member_id):
    if member_id >= len(execution_engine.current_members):
        return
    me = execution_engine.current_members[member_id]

    # Check relationships
    attack_matrix = execution_engine.relationship_dict['victim']
    benefit_matrix = execution_engine.relationship_dict['benefit']
    benefit_land_matrix = execution_engine.relationship_dict['benefit_land']

    # Find members who have attacked me the most
    if member_id < attack_matrix.shape[0]:
        attacks_against_me = attack_matrix[:, member_id]
        top_attackers = attacks_against_me.argsort()[::-1]
        for attacker_id in top_attackers:
            if attacker_id == member_id or attacker_id >= len(execution_engine.current_members):
                continue
            target = execution_engine.current_members[attacker_id]
            if target.id != member_id:
                execution_engine.attack(me, target)
                return

    # If vitality is high, offer protection to a member who has land
    if me.vitality > 70.0:
        for idx, member in enumerate(execution_engine.current_members):
            if member.id == member_id or idx >= len(execution_engine.current_members):
                continue
            if benefit_land_matrix[member_id][member.id] > 0:
                execution_engine.offer(me, member, True)
                return

    # If no attacks or offers made, perform bear action on a member with land
    for idx, member in enumerate(execution_engine.current_members):
        if member.id == member_id or idx >= len(execution_engine.current_members):
            continue
        if benefit_land_matrix[member_id][member.id] > 0:
            execution_engine.bear(me, member)
            return

def agent_action(execution_engine, member_id):
    if member_id >= len(execution_engine.current_members):
        return
    me = execution_engine.current_members[member_id]

    # Function to find a valid member by index
    def get_member(index):
        if 0 <= index < len(execution_engine.current_members):
            return execution_engine.current_members[index]
        return None

    # Analyze if need to seek protection or trade
    if me.vitality < 40.0:
        # Find the member with the highest benefit to offer protection/trade
        benefit = execution_engine.relationship_dict['benefit'][me.id]
        best_member = None
        max_benefit = -1
        for idx, val in enumerate(benefit):
            if idx != member_id and idx < len(execution_engine.current_members):
                if val > max_benefit:
                    max_benefit = val
                    best_member = get_member(idx)
        if best_member:
            execution_engine.offer(me, best_member, True)
            return

    else:
        # Attack the member who has attacked me the most
        victim_matrix = execution_engine.relationship_dict['victim'][me.id]
        if len(victim_matrix) > 1:
            # Find the member with the highest attack count
            target_idx = -1
            max_attacks = -1
            for idx, attacks in enumerate(victim_matrix):
                if idx != member_id and attacks > max_attacks and idx < len(execution_engine.current_members):
                    max_attacks = attacks
                    target_idx = idx
            if target_idx != -1:
                target = get_member(target_idx)
                if target:
                    # Verify the target has land before attacking
                    benefit_land = execution_engine.relationship_dict['benefit_land'][target.id][target_id]
                    if benefit_land > 0:
                        execution_engine.attack(me, target)

